import React, {useState} from 'react'

function Todo({todo}) {
    const [complete, setComplete] = useState(false)


    return (
        <div className={complete ? 'todo-row-complete': 'todo-row'} onClick={e => {setComplete(!complete)}}>
            {todo.value}
            <button className ="todo-delete">Delete</button>
        </div>
    )
}

export default Todo
